import{_ as e,o as a,c as t,Q as o}from"./chunks/framework.4719a631.js";const v=JSON.parse('{"title":"Live Trading","description":"","frontmatter":{"title":"Live Trading"},"headers":[],"relativePath":"docs/livetrade.md","filePath":"docs/livetrade.md"}'),n={name:"docs/livetrade.md"},s=o('<h1 id="live-trade" tabindex="-1">Live Trade <a class="header-anchor" href="#live-trade" aria-label="Permalink to &quot;Live Trade&quot;">â€‹</a></h1><p>Live and paper trading functionality is supported by Jesse via an official plugin.</p><h2 id="getting-started" tabindex="-1">Getting started <a class="header-anchor" href="#getting-started" aria-label="Permalink to &quot;Getting started&quot;">â€‹</a></h2><p>To get started, you need to register on our website to generate your license key. Once you have your license key, you can <a href="/docs/livetrade.html#installation">install</a> the plugin.</p><p>We have made sure to make the installation process as easy as possible. In fact, if you already have Jesse installed, you can install the plugin in just a few seconds.</p><h2 id="paper-trading" tabindex="-1">Paper Trading <a class="header-anchor" href="#paper-trading" aria-label="Permalink to &quot;Paper Trading&quot;">â€‹</a></h2><p>Paper trading is possible with Jesse and is a good way to test-drive a strategy without risking real money.</p><p>You can enable paper trading by turning on the &quot;Paper Trade&quot; option on the &quot;Live&quot; page of the dashboard.</p><h2 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">â€‹</a></h2><p>The package is pre-built and the access is limited to those with an active license. We made sure the installation is easy and made it automated as much as possible.</p><div class="tip custom-block"><p class="custom-block-title">ðŸŽ¥ Video Tutorial</p><p>In case you prefer watching a video, here&#39;s a <a href="https://www.youtube.com/watch?v=cUNX5FAVVYo" target="_blank" rel="noreferrer">short screencast of installing the plugin on remote server for live trading</a>.</p></div><h3 id="_1-creating-a-license-key" tabindex="-1">1. Creating a license key <a class="header-anchor" href="#_1-creating-a-license-key" aria-label="Permalink to &quot;1. Creating a license key&quot;">â€‹</a></h3><p>First, you need to create a license access key. Assuming you are already logged in to your Jesse.Trade account, go into the <a href="https://jesse.trade/user/api-tokens" target="_blank" rel="noreferrer">API Tokens</a> page and generate a new token. The name of it doesn&#39;t matter. Then copy the token and paste it into the <code>LICENSE_API_TOKEN</code> variable inside your project&#39;s <code>.env</code> file.</p><p>Now, assuming whether you are using Jesse with the Docker setup, or you installed the environment natively, <strong>you have to choose your second step</strong>:</p><h3 id="_2-docker-environment" tabindex="-1">2. Docker environment <a class="header-anchor" href="#_2-docker-environment" aria-label="Permalink to &quot;2. Docker environment&quot;">â€‹</a></h3><p>If you are using Jesse using our <a href="./getting-started/docker.html">first-class Docker setup</a>, <strong>you don&#39;t have to do anything</strong>!</p><p>Jesse will pick up on the change you just made in your <code>.env</code> file, download and install the correct version of the plugin for you.</p><h3 id="_2-native-environment-setups" tabindex="-1">2. Native environment setups <a class="header-anchor" href="#_2-native-environment-setups" aria-label="Permalink to &quot;2. Native environment setups&quot;">â€‹</a></h3><p>All you have to do is to run a single command which will automatically download the correct version of the package according to your machine&#39;s CPU architecture, OS, Python version, and Jesse version:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#B392F0;">jesse</span><span style="color:#E1E4E8;"> </span><span style="color:#9ECBFF;">install-live</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#6F42C1;">jesse</span><span style="color:#24292E;"> </span><span style="color:#032F62;">install-live</span></span></code></pre></div><h2 id="update" tabindex="-1">Update <a class="header-anchor" href="#update" aria-label="Permalink to &quot;Update&quot;">â€‹</a></h2><p>To update to the latest versions, usually you have to update Jesse itself first, and then the plugin. Here&#39;s the <a href="/docs/getting-started/update.html">guide</a>.</p>',22),i=[s];function r(l,d,c,p,h,u){return a(),t("div",null,i)}const y=e(n,[["render",r]]);export{v as __pageData,y as default};
